import React, { useEffect, useState } from 'react'
import PortfolioList from '../portfolioList/PortfolioList'
import './portfolio.scss'
import {CRYPTO, TVSHOW, Plants, Bubble, featuredPortfolio} from '../../data'


export default function Portfolio() {
    const [selected, setSelected] = useState('featured')
    const [data, setData] = useState([])
    const list = [
        {
            id: 'featured',
            title: 'Featured'
        },
        {
            id: 'web',
            title: 'Crypto Tracker'
        },
        {
            id: 'tvShowSelector',
            title: 'TV Show Selector'
        },
        {
            id: 'reactPlants',
            title: 'React Plants Ecommerce'
        },
        {
            id: 'bubblePicker',
            title: 'Bubble Color Picker'
        }
    ]

    useEffect(() => {

        switch(selected){
            case 'featured': 
            setData(featuredPortfolio);
            break;
            case 'featured': 
            setData(featuredPortfolio);
            break;
            case 'featured': 
            setData(featuredPortfolio);
            break;
            case 'featured': 
            setData(featuredPortfolio);
            break;
        }

    }, [selected])
    return (
        <div className='portfolio' id='portfolio'>
            <h1>Portfolio</h1>
            <ul>
                {list.map(item => (
                    <PortfolioList title={item.title} active={selected === item.id} setSelected={setSelected} id={item.id}/>
                ))}
            </ul>
            <div className="container">
                <div className="item">
                    <img src='assets/crypto.png' alt='crypto-tracker'/>
                    <h3>Crypto Tracker (Dark Mode)</h3>
                </div>
                <div className="item">
                    <img src='assets/TV.png' alt='crypto-tracker'/>
                    <h3>TV Show Selector (Jest Testing)</h3>
                </div>
                <div className="item">
                    <img src='assets/plants.png' alt='crypto-tracker'/>
                    <h3>React Plants Ecommerce </h3>
                </div>
                <div className="item">
                    <img src='assets/ColorPicker.png' alt='crypto-tracker'/>
                    <h3>Bubble Color Picker</h3>
                </div>

            </div>
        </div>
    )
}
